import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from "./Home"

function App() {
  return (
    <Router>
    <div className="App">
      <h1>スペイン語学習を始める</h1>    
      <Switch>
        <Route path="/dashboard" exact component={Dashboard} />
        <Route path="/" exact component={Home} />


      </Switch>

    </div>
    </Router>
  );
}

function Dashboard() {
  return (
    <div class = "select_button">
        <h1>スペイン語活用練習</h1>
        <button onclick="location.href='/quiz.html'">クイズ</button>
        <button onclick="location.href='/input.html'">練習する</button>
    </div>

  );
}

export default App;
